import React from "react";

export default function Suggest(props) {
  return (
    <div className="movie-container">
      <img src={props.url} alt="영화포스터" />
      <div className="movie-info">
        <h4>{props.text}</h4>
        <h4>{props.price}원</h4>
      </div>
    </div>
  );
}
